const ParkingDetail = (props) => {

    return (
        <div className="m-2">
        {/* Display the article details if article is not None */} 
              <div key= {parking.id}>
                <h2 className="text-primary"> { parking.id} </h2>
                <p> { parking.entry } </p>
                <p> { parking.depart } </p>
    	        <hr/>
              </div>
        </div>
        )
}

export default ParkingDetail;
